import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import { SketchPicker } from 'react-color'

class App extends Component {

  render() {
    const handleColorChange = ({ hex }) => console.log(hex)
    return (
      <div className="App">
        <SketchPicker 
        onChangeComplete={ handleColorChange }
        />
      </div>
    );
  }
}

export default App;
